import React, { Component } from 'react';
import { connect } from "react-redux";
import { Redirect } from "react-router-dom";

import "./Navbar.css";

class Homepage extends Component {

  render() {

    return (
      <div>
        <span className="nav-item">Home</span>
        <span className="nav-item">Leaderboard</span>
        <span className="nav-item">Add Question</span>
        <span className="nav-item">Logged in as: "Tyler McGinnis</span>
        <span className="nav-item"><button>Log Out</button></span>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    username: state.authedUser.username
  };
}

export default connect(mapStateToProps)(Homepage);
